Docs.remarks:
Schema for Request Body:
{
  farmerId: string (required),
  oAuthProviderId: string (required),
  userRedirectLink: string (required),
  userRedirectState: string
}

Schema for Response Error:
{
  error: {
    code: string,
    message: string,
    target: string,
    details: [Error],
    innererror: {
      code: string,
      innererror: InnerError
    }
  },
  traceId: string
}

